  dft_ohpp = (TEN_ohpp_t *)CS_MALLOC(sizeof(TEN_ohpp_t));
  
  /* Bug #38811: Debug APIs need malloc check for Klocwork warning */
  if ((tmp_ohpp == 0) || (dft_ohpp == 0)) {
    if (tmp_ohpp) {
      CS_FREE(tmp_ohpp);
    }
    if (dft_ohpp) {
      CS_FREE(dft_ohpp);
    }
    CS_HNDL_ERROR(module_id, ETEN_MOD_INVALID_USER_ARG, ": out of memory.");
    return (CS_ERROR);
  }
  
